import './App.css';
import { Navbar } from './Component/Navbar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import { Product } from './Pages/Product';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar></Navbar>

        <Routes>
          <Route path='/' element={<Shop></Shop>} />
          <Route path='/mens' element={<ShopCategory category="men"></ShopCategory>} />
          <Route path='/womens' element={<ShopCategory category="women"></ShopCategory>} />
          <Route path='/kids' element={<ShopCategory category="men"></ShopCategory>} />
          <Route path='/product' element={<Product></Product>} />
          <Route path='productId' element={<Product></Product>}></Route>


        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
